CFR/API_Guide.html.body:
CFR API란? 
Clova Face Recognition API(이하 CFR API)는 이미지 데이터를 입력받은 후 얼굴 인식 결과를 JSON 형태로 반환합니다. CFR API는 이미지에 있는 얼굴 인식하여 분석 정보를 제공하는 얼굴 감지 API와 닮은 연예인을 알려주는 유명인 얼굴 인식 API를 제공합니다. CFR API는 HTTP 기반의 REST API이며, 사용자 인증(로그인)이 필요하지 않은 비로그인 Open API입니다.
사전 준비사항 
CFR API를 사용하려면 개발하려는 애플리케이션을 네이버 개발자 센터에 등록해야 합니다. 이때, 사용할 API에 대한 권한을 설정해야 하며, API 사용 시 필요한 인증 정보를 획득해야 합니다. 애플리케이션 등록을 참고하여 다음과 같이 필요한 사항을 미리 준비합니다.


애플리케이션 등록하기를 통해 앱 등록 페이지로 이동합니다.
사용 API에서 얼굴인식(CFR API)을 선택합니다.
비로그인 오픈 API 서비스 환경에 WEB 설정을 추가하고 웹 애플리케이션의 웹 서비스 URL을 입력합니다.
등록하기 버튼을 클릭합니다. 버튼을 클릭하면 내 애플리케이션 메뉴로 이동하며 방금 등록한 앱의 정보가 화면에 표시됩니다. 이 페이지에서 Client ID와 Client Secret 정보를 확인할 수 있습니다.

CFR API 사용하기 
CFR API는 REST API이며, 얼굴 인식을 수행할 이미지 데이터를 HTTP 통신으로 음성 합성 서버로 전달하면 됩니다. 음성 합성 서버가 제공하는 REST API의 URI는 다음과 같으며 POST 방식으로 연결을 시도해야 합니다.
// 유명인 얼굴 인식 API
https://openapi.naver.com/v1/vision/celebrity

// 얼굴 감지 API
https://openapi.naver.com/v1/vision/face
HTTP 요청으로 얼굴 인식을 요청할 때 사전 준비사항에서 발급받은 Client ID와 Client Secret 정보를 헤더에 포함시켜야 합니다. 또한 요청을 multipart 형식으로 보내야 하며, 메시지의 이름은 image여야 합니다. 다음은 유명인 얼굴 인식 API를 호출할 때 보내는 HTTP 요청 메시지 예입니다.
[HTTP Request Header]
POST /v1/vision/celebrity HTTP/1.1
Host: openapi.naver.com
Content-Type: multipart/form-data; boundary={boundary-text}
X-Naver-Client-Id: {앱 등록 시 발급받은 Client ID}
X-Naver-Client-Secret: {앱 등록 시 발급 받은 Client Secret}
Content-Length: 96703

--{boundary-text}
Content-Disposition: form-data; name="image"; filename="test.jpg"
Content-Type: image/jpeg

{image binary data}
--{boundary-text}--
HTTP 요청을 통해 보내는 이미지의 포맷에 대한 제약은 없습니다. 다만 GIF와 같은 이미지 포맷은 첫 번째 프레임의 이미지를 기준으로 얼굴 인식을 수행합니다.

  Note!
  서버로 전달할 수 있는 이미지의 크기는 최대 2MB입니다.


위와 같은 HTTP 요청을 얼굴 인식 서버로 전달하면 얼굴 인식 서버는 JSON 형태의 분석 결과 데이터를 HTTP 응답 메시지로 반환합니다. 다음은 응답 예제입니다.
{
     "info": {
         "size": {
             "width": 900,
             "height": 675
         },
         "faceCount": 2
     },
     "faces": [{
         "celebrity": {
             "value": "안도하루카",
             "confidence": 0.266675
         }
     }, {
         "celebrity": {
             "value": "서효림",
             "confidence": 0.304959
         }
     }]
 }
위와 같은 방식으로 얼굴 감지 API도 사용할 수 있으며, API별에 따라 분석 결과에 따라 응답 메시지로 전달되는 JSON 데이터의 내용이 달라집니다. 이에 자세한 명세는 CFR API 레퍼런스를 참조합니다.
